  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Data" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Data</b> <i>&lt;context&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="itemCount__key" align="left" balign="left">itemCount</td><td port="itemCount__value" align="left" balign="left">0</td></tr></table></td></tr></table>>, pad=0.5, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C", URL="#L5:0-7:1"];
  "CheckData" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CheckData</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Check data</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2", URL="#L9:0-9:28"];
  "ProcessNormal" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessNormal</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Normal processing</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2", URL="#L10:0-10:39"];
  "ProcessUrgent" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessUrgent</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Urgent processing</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2", URL="#L11:0-11:39"];
  "ProcessDefault" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessDefault</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Default processing</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2", URL="#L12:0-12:41"];

  // Edges
  "CheckData" -> "ProcessUrgent" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><i>@priority("1")</i></td></tr><tr><td align="left"><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">when</td><td align="left" balign="left">Data.itemCount &gt; 100</td></tr></table></td></tr></table>>, labelOverlay="75%", edgeURL="#L15:10-15:72", when="Data.itemCount > 100", style=solid, color="#4CAF50", penwidth=2];
  "CheckData" -> "ProcessNormal" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><i>@priority("2")</i></td></tr><tr><td align="left"><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">when</td><td align="left" balign="left">Data.itemCount &gt; 0</td></tr></table></td></tr></table>>, labelOverlay="75%", edgeURL="#L16:10-16:70", when="Data.itemCount > 0", style=solid, color="#4CAF50", penwidth=2];
  "CheckData" -> "ProcessDefault" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><i>@priority("3")</i></td></tr></table>>, labelOverlay="75%", edgeURL="#L17:10-17:42"];

  // Inferred Dependencies
  "CheckData" -> "Data" [label="condition references Data", style=dashed, color=blue];
  "CheckData" -> "Data" [label="condition references Data", style=dashed, color=blue];
}
